import { Col, Container, Row } from "react-bootstrap";

function Main(){
    return(
        <Container>
            <Row>
                <Col lg = "8" md = "12" sm = "12">
                    <h1>Locally</h1>
                </Col>
                <Col lg = "4" md = "0" sm = "0"></Col>
            </Row>
        </Container>
    )
}

export default Main
